['Inclusion Criteria:

aged 18 years and older living in the State of Texas, USA;
the ability to read and type in English or Spanish;
no barriers to using a computer (e.g. no significant fine motor control or visual problems);
Internet and e-mail access and the ability to use it;
commitment to completing the program;
completion of the online screening and outcome questionnaires;
agreeing to participate in either group and be randomized to one of these groups;
understanding and working towards the end goal of reducing the impact and distress of tinnitus, although the strength of the tinnitus may remain the same;
be available for 12 months after starting the study to complete a 1-year follow-up questionnaire;
suffering with experiencing tinnitus for a minimum period of 3 months; and
tinnitus outcome measure scores indicating the need for tinnitus care [25 or above on the Tinnitus Functional Index (TFI)].

Exclusion Criteria:

reporting any major medical or psychiatric conditions;
reporting pulsatile, objective or unilateral tinnitus, which has not been investigated medically;
tinnitus as a consequence of a medical disorder, still under investigation; and
undergoing any other tinnitus therapy while participating in this study.']

['Clinical Criteria

Non-pregnant female ≥18 years of age;
Rutherford Clinical Category 2-4;

Patient is willing to provide informed consent, is geographically stable, comply with the required follow up visits and testing schedule;

Angiographic Criteria

De novo or restenotic lesion(s) in native superficial femoral or popliteal arteries;
Lesion ≥70% stenosis by visual estimate;
Target reference vessel diameter of 4-7 mm;
A patent inflow artery free from significant lesion (≥50% stenosis) as confirmed by angiography; (Treatment of target lesion acceptable after successful treatment of inflow artery lesions. Successful inflow artery treatment is defined as attainment of residual diameter stenosis ≤30% without death or major vascular complication.)
At least one patent native outflow artery to the ankle, free from significant (≥50%) stenosis as confirmed by angiography after successful vessel preparation;
Successful antegrade wire crossing and vessel preparation (may include pre-dilatation) of the target lesion. Successful vessel preparation is defined by residual stenosis ≤30% without any major vascular complications;
No other prior vascular interventions within 2 weeks before and/or planned 30 days after the protocol treatment except for remote common femoral patch angioplasty separated by at least 2 cm from the lesion(s).

Exclusion Criteria

Life expectancy of <2 years;
Subject is currently participating in an investigational drug or device study, or previously enrolled in this study. Enrollment in another investigational drug or device study during the follow up period is not allowed;
History of stroke within 3 months;
History of myocardial infarction (MI), thrombolysis or angina within 2 weeks of index procedure;
Renal failure or chronic kidney disease with serum creatinine ≥2.5 mg/L within 30 days of index procedure or treated with dialysis;
Sudden symptom onset, acute vessel occlusion, or acute or sub-acute thrombus in target vessel.']

['Inclusion Criteria:

Age >= 18 years. 2. Patient receiving HIV care at UAB 1917 Clinic. 3. Elevated symptoms of depression, anxiety, post-traumatic stress, or substance use disorder: At least one of the following:

Patient Health Questionnaire-9 score >= 10;
Generalized Anxiety Disorder 7-Item Scale score >= 10;
Post-Traumatic Stress Symptoms Checklist for DSM-5 score >= 33;
ASSIST score >=11 for alcohol or >=4 for any other substance 4. At risk for suboptimal HIV care engagement: At least one of the following:
Engaged in HIV care for the first time within the past 6 months;
Have an HIV RNA viral load >1,000 copies/mL within the past 6 months;
Antiretroviral regimen was changed due to treatment failure within the past 6 months;
No-showed to an HIV primary care appointment within the past year. 5. Willing to provide written informed consent.

Exclusion Criteria:

1. Non-English speaking 2. Unable to attend counseling sessions 3. Unwilling to provide informed consent']

['Inclusion Criteria:

having good oral hygiene;
need for at least two or more posterior restorations in contact with neighbouring tooth and in occlusion with antagonist teeth;
teeth planned to be restore should be vital and symptomless;
the cavity isthmus size should be more than 1/3 of the intercuspal distance.

Exclusion Criteria:

absence of adjacent and antagonist teeth;
teeth with periodontal problems;
teeth with preoperative pain or pulpal inflammations;
teeth formerly subjected to direct pulp capping;
patients having severe systemic diseases, allergies or adverse medical history.']

['Inclusion Criteria:

Healthy adults (male or non-pregnant, non-lactating female) 18 to 55 years of age;
Able to provide free and willing written informed consent to participate;
A score at least 80% correct on a 10 question Assessment of Understanding;
No plans to travel to a malaria endemic area during the course of the study;
Duffy positive phenotype;
Normal (non-deficient) G6PD phenotype (range : 4.6 to 13.5 u/gm hemoglobin);
Free of significant health problems as established by medical history and clinical examination completed prior to the study;
Available to participate and reachable by phone for duration of study (approximately 9 months starting from screening).
Only subjects with no or low cardiac risk factors according to the Gaziano study and a normal EKG will be included in the study

Exclusion Criteria:

Pregnant or nursing at screening or plans to become pregnant or nurse from the time of enrollment until 6 months after sporozoite challenge;
Duffy negative phenotype;
G6PD deficiency or have any hemoglobinopathy by history;
Past infection with any species of malaria (as demonstrated by a positive thick smear) in the last 5 years;
History of receipt of treatment or prophylaxis for malaria during the previous 6 months;
History of receipt of malaria vaccine within the previous 5 years;
History of receipt of malaria challenge (being bitten by experimentally infected mosquitoes) within the previous 5 years;
Plans to travel to malarious areas during the study period;
Allergy to antimalarials or significant (e.g. systemic) hypersensitivity reactions to mosquito bites (local hypersensitivity reactions at the site of a mosquito bite are not an exclusion criterion);
History of psoriasis (given its interaction with chloroquine);
Use of any investigational or non-registered drug or vaccine within 30 days preceding the challenge or planned use during the study period;
Use or planned use of any drugs with significant anti-malarial activity, such as doxycycline, clindamycin, azithromycin, during the study period (volunteers can withhold the use of these medications during the study period, at the minimum starting from 4 weeks before the challenge until 4 weeks after becoming parasitemic);
Any confirmed or suspected immunosuppressive or immunodeficient condition, including HIV infection and history of splenectomy;

Administration of chronic (defined as more than 14 days) immunosuppressants or other immune-modifying drugs within six months of challenge;

For corticosteroids, this is defined as prednisone, or equivalent, 0.5 mg/kg/day;
Inhaled and topical steroids are allowed;
A family history of congenital or hereditary immunodeficiency;
Chronic or active neurologic disease including seizure disorder;

Acute or chronic, clinically significant pulmonary, cardiovascular, hepatic, or renal functional abnormality, as determined by medical history, physical examination, or abnormal baseline laboratory screening tests:

ALT above normal range (table 9);
Creatinine above normal range (table 9);
Hemoglobin below normal range (table 10);
Platelet count below normal range (table 10);
Total white cell count below normal range (table 10);

Acute disease at the time of enrollment

Acute disease is defined as the presence of a moderate or severe illness with or without fever;
Challenge can be administered to persons with a minor illness, such as diarrhea or mild upper respiratory infection without fever (i.e., oral temperature < 38°C/100.4°F);
Hepatomegaly, right upper quadrant abdominal pain or tenderness;
Seropositive for HIV, hepatitis C virus (antibodies to HIV and HCV), and/or HBsAg;
Administration of immunoglobulins and/or any blood products within the 3 months preceding challenge or planned administration during the study period;
Suspected or known current alcohol abuse/drug abuse as obtained by history and physical examination;
Inability to make follow-up visits;
Any other significant finding that in the opinion of the investigator would increase the risk of having an adverse outcome from participating in this study.']

["Inclusion Criteria:

If an active duty military personnel, must be between the ages of 18 to 60 years at the time of enrollment.
If a veteran, must be between the ages of 19 to 60 years at the time of enrollment
Tinnitus disturbance determined at the initial pre-enrollment assessment to be clinically significant, as denoted by a score on the TRQ of 17-70; and
Four frequency (0.5, 1, 2, and 4 kHz) pure tone average in one ear (0.5, 1, 2, and 4 kHz) is equal to or less than 50dB HL, as determined by audiometry performed at the initial pre-enrollment assessment; and
Cognitive, comprehension and manual dexterity abilities sufficient to self-administer treatment, and ability to travel to attend appointments, as necessary, as determined at the initial pre-enrollment assessment; and
Motivated to pursue treatment and has appropriate expectations as to treatment outcomes (including the possibility of being assigned to the placebo group), as determined at the initial pre-enrollment assessment.
Must have access to healthcare for follow-up care for the six month study period

Exclusion Criteria:

Refusal to give consent
Significant psychological disturbance [defined as any rating other than 0 on Question Number 24 the TRQ (suicidal ideology) or a score of more than 78 on the Tinnitus Handicap Inventory (THI)] that may interfere with the treatment as assessed by the treating clinician and/or referring physician;
Complicating medical conditions such as acute/unstable Meniere's disease as inferred by responses on the Tinnitus History Questionnaire (THQ);
Ongoing use of ototoxic medications (THQ);
Pulsatile tinnitus (THQ);
Continued excessive noise exposure without effective hearing protection (THQ);
After all elements of informed consent are completed and the TRQ has been scored, a score of less than 17 will exclude the volunteer from participation."]

['Inclusion Criteria:

Male and female subjects age 22 years of age and older either active duty or dependents who are eligible for care;

Myopia from ≥ 0 D to ≤ -10.00 D with ≤ -3.00 D cylinder and MRSE ≥ -1.00 D to

≤ -11.50 D in the eye(s) to be treated;

A stable refraction for the past year, as demonstrated by a change in MRSE of ≤ 0.50 D in the eyes to be treated;

A difference between cycloplegic and manifest refractions of

≤ 0.75 D spherical equivalent in both eye(s);

UCVA 2 lines worse than BCVA in the treated eye(s);
BSCVA at least 20/20 in the treated eye(s);
Discontinue use of contact lenses for at least 4 weeks (for hard lenses) or 2 weeks (for soft lenses) prior to the preoperative examination, and through entire study. The subject shall not be considered a contact lens wearer if they are not wearing hard contact lenses for 4 weeks or soft contact lenses for 2 weeks.
All contact lens wearers must demonstrate a stable refraction (within ±0.5 D), as determined by MRSE, on two consecutive examinations at least 7 days apart, in the eye(s) to be treated;
Central corneal thickness of at least 500 microns in the both eye(s);
Willing and able to return for scheduled follow-up examinations;
Able to provide written informed consent and follow study instructions in English.
Permission of the Commanding Officer for active duty subjects to receive refractive surgery and participate in the study.

Exclusion Criteria:

Manifest cylinder of more than -3.00 D;
Estimated treatment depth is less than 250 microns from the corneal endothelium;
Eye to be treated is targeted for monovision;
Keratometry readings via Sim-K values less than 40.00 D;
Abnormal corneal topographic findings, e.g. keratoconus, pellucid marginal degeneration in either eye;
History of or current anterior segment pathology, including cataracts in the eye to be treated;
Clinically significant dry eye syndrome unresolved by treatment in either eye;
Residual, recurrent, active ocular or uncontrolled eyelid disease, corneal scars or other corneal abnormality such as recurrent corneal erosion or severe basement membrane disease in the either eye;
Ophthalmoscopic signs of progressive or unstable myopia or keratoconus (or keratoconus suspect) in either eye;
Irregular or unstable (distorted/not clear) corneal mires on central keratometry images in either eye;
History of ocular herpes zoster or herpes simplex keratitis;
Deep orbits, strong blink, anxiety, pterygium, or any other finding suggesting difficulty in achieving or maintaining suction;
Difficulty following directions or unable to fixate;
Previous intraocular or corneal surgery of any kind in the eye to be treated, including any type of surgery for either refractive or therapeutic purposes;
History of steroid-responsive rise in intraocular pressure, glaucoma, or preoperative IOP > 21 mmHg in either eye;
History of diabetes, diagnosed autoimmune disease, connective tissue disease or clinically significant atopic syndrome;
Immunocompromised or requires chronic systemic corticosteroids or other immunosuppressive therapy that may affect wound healing;
History of known sensitivity to planned study medications;
Participating in any other ophthalmic drug or device clinical trial during the time of this clinical investigation;
Pregnant or lactating;
Anyone who has the potential to deploy or relocate during the follow-up period.
Systemic Medications that may confound the outcome of the study or increase risk to the subject, including but not limited to steroids, antimetabolites, etc.
Evidence of retinal vascular disease.
Glaucoma suspects by exam findings or family history.']

["Inclusion Criteria:

Subject must provide signed written informed consent;
Men and women greater than or equal to 18 years of age at Screening;

Diagnosis of primary (essential) hypertension (HTN) for at least 3 months prior to Screening and have an office SBP:

Between 145 mmHg and 170 mmHg at Screening and are treatment-naïve; or
Between 130 mmHg and 150 mmHg at Screening and are treated with less than or equal to 2 anti hypertensive medications. Anti-hypertensive medications must be stable for greater than or equal to 8 weeks prior to Screening;
SBP between 145 mmHg and 170 mmHg, inclusive, and DBP less than or equal to 105 mmHg at the Inclusion Visit after 2-week Run In Period;
Body mass index between 25 kg/m2 and 45 kg/m2 with the ability to fit the ambulatory blood pressure monitoring (ABPM) cuff per the manufacturer;
Subject must have a successful ABPM measurement prior to receiving the study drug.
Women of childbearing potential and non-surgically sterile male subjects who are sexually active must agree to use an approved highly effective form of contraception from the time of informed consent until 30 days post-dose.
Women of childbearing potential must have a negative serum pregnancy test result at Screening and a negative urine pregnancy test result at the Inclusion Visit (Day 0).

Exclusion Criteria:

Known or suspected secondary HTN (eg, renal artery stenosis, pheochromocytoma, Cushing's disease);
Office SBP greater than or equal to 171 mmHg and/or office diastolic blood pressure (DBP) greater than or equal to 105 mmHg at the Inclusion Visit (Day 0) and confirmed by a second measurement (not on the same day), preferably within 1 day;
Known hypertensive retinopathy (Keith-Wagener Grade 3 or Grade 4) and/or hypertensive encephalopathy;
History of spontaneous or drug-induced angioedema;
Clinically significant valvular heart disease or severe aortic stenosis;
Subjects with symptomatic heart failure (New York Heart Association Class II to Class IV);
History of acute coronary syndrome (non-ST elevation myocardial infarction, ST elevation myocardial infarction, and unstable angina pectoris), stroke, or transient ischemic attack within 6 months prior to Screening;
Known history of malabsorption syndrome, or has undergone gastrointestinal surgery, including bariatric procedures, that induce chronic malabsorption, within 2 years of Screening;
Treatment with anti-obesity drugs or procedures 3 months prior to Screening (ie, surgery, aggressive diet regimen, etc.), leading to unstable body weight;
Female who is breast feeding, pregnant, or planning to become pregnant during the study period;
Medical history of cancer (except for basal cell carcinoma) and/or treatment for cancer within the last 5 years;
Subject with an upper arm circumference that exceeds the upper circumference level (48.3 cm) of the cuff size of either the ABPM and/or office BP (OBP) measurement device used in the study;
Night shift workers who routinely sleep during the daytime and/or whose work hours include midnight;
Alanine aminotransferase, aspartate aminotransferase, or alkaline phosphatase >3 x upper limit of normal (ULN) or a total bilirubin greater than or equal to 2 x ULN (unless secondary to Gilbert's syndrome) at Screening or the Inclusion Visit (Day 0);
Estimated glomerular filtration rate <45mL/min/1.73m2, as calculated using the Chronic Kidney Disease Epidemiology Collaboration formula at Screening or the Inclusion Visit (Day 0);
History of any blood disorder, other than sickle cell trait, causing hemolysis or unstable red blood cells (eg, malaria, babesiosis, hemolytic anemia, thalassemia, sickle cell anemia);
Subjects with type 1 diabetes mellitus;

Subjects with type 2 diabetes mellitus who:

Are poorly controlled, defined as hemoglobin A1c >8% at Screening; or
Are taking short-acting insulin or sodium-glucose co transporter 2 inhibitors. Use of a stable dose (greater than or equal to 12 weeks prior to Screening) of medications listed in Appendix C is permitted;
Routine or anticipated treatment with all systemic corticosteroids. Use of topical, inhaled, or nasal corticosteroids is permitted;

Clinical evidence of thyroid disease, thyroid hormone therapy that is not stable greater than or equal to 4 weeks prior to Screening, or subjects with the following thyroid-stimulating hormone (TSH) levels at Screening:

For subjects on replacement therapy: TSH 0.75 to 1.5 x ULN; or
For subjects not on replacement therapy: TSH >1.5 x ULN;
History of alcohol or drug abuse within the 3 months prior to Screening that would interfere with study participation or lead to decreased compliance to study procedures or study drug intake in the Investigator's opinion;
Participation in another clinical study involving an investigational drug within 30 days prior to Screening, or plans to participate in another clinical study within 30 days of discontinuation of study drug;
Any condition, in the opinion of the Investigator, that would interfere with study participation, may pose a risk to the subject, or would make study participation not in the best interest of the subject;
Subjects with a life expectancy of less than 1 year per Investigator's discretion; or
Any subject who, in the opinion of the Investigator, will not be able to follow the protocol."]
